/// <summary>
/// The <c>WHSMobileAppErrorCodes</c> contains special error codes, that are added to exception message text
/// thrown as unhandled exceptions as part of warehouse mobile device flows.
/// The warehouse management app will then handle these accordingly.
/// </summary>
public static final class WHSMobileAppErrorCodes
{
    public const str WorkUserSessionInProgressError = 'ERROR_SESSION_BUSY';

    public const str RequestXmlPotentialTamperingError = 'REQUEST_XML_TAMPERING';

    public const str UserLoginMultipleDevicesError = 'MULTI_DEVICE_USER_LOGIN';

    public const str RequestSessionTokenError = 'REQUEST_SESSION_TOKEN_ERROR';
}
